pragma solidity ^0.4.0;

import './AbstractENS.sol';
import './strings.sol';

contract SecondaryRegistrar {
    using strings for *;
    AbstractENS ens;

    bytes32[] dA;
    bytes32[] auctions;

    struct Record {
        address owner;
        uint amount;
        bool available;
        string name;
        string subDomain;
    }

    struct AuctionRecord {
        address owner;
        uint minAmount;
        bool available;
        string name;
        string subDomain;
        uint expiryTime;
    }

    struct Bid {
        address bidder;
        uint amount;
        string name;
        string subDomain;
    }

    mapping(bytes32=>Record) records;
    mapping(bytes32=>Bid[]) bidsForName;
    mapping(bytes32=>Bid) bestBid;
    mapping(bytes32=>AuctionRecord) aRecords;

    event LogAddress(address addr);
    event LogAmount(uint amt);
    event LogString(string s);

    /**
     * Constructor.
     * @param ensAddr The address of the ENS registry
     */
    function SecondaryRegistrar(AbstractENS ensAddr) {
        ens = ensAddr;
    }

    function startAuctionDomain(string name, uint amount, uint timeInSeconds) public {
        var node = namehash(name);
        require(ownsNode(node) == true);
        var expiryTime = now + timeInSeconds * 1 seconds;
        aRecords[node].name = name;
        aRecords[node].minAmount = amount;
        aRecords[node].subDomain = "";
        aRecords[node].available = true;
        aRecords[node].expiryTime = expiryTime;
        aRecords[node].owner = msg.sender;
        bestBid[node] = Bid(msg.sender, 0, name, "");
        auctions.push(node);
    }

    function getAuctionRecord(uint i) returns(string, string, bool, uint, uint) {
        var b = aRecords[auctions[i]];
        return (b.name, b.subDomain, b.available, b.minAmount, b.expiryTime);
    }

    function getAuctionCount() returns (uint) {
        return auctions.length;
    }

    function bidDomain(string name) payable {
        var node = namehash(name);
        require(msg.value > aRecords[node].minAmount);
        require(aRecords[node].available == true);
        var b = Bid(msg.sender, msg.value, name, "");
        bidsForName[node].push(b);
        if (b.amount > bestBid[node].amount) {
            bestBid[node].bidder.transfer(bestBid[node].amount);
            bestBid[node] = b;
            aRecords[node].expiryTime = aRecords[node].expiryTime + 60 * 1 seconds;
        }
    }

    function getBestBidder(string name) returns (address){
        var node = namehash(name);
        return bestBid[node].bidder;
    }

    function finalize(string name) {
        var node = namehash(name);
        require(aRecords[node].available == true);
        require(bestBid[node].bidder == msg.sender);
        ens.setOwner(node, msg.sender);
        aRecords[node].available = false;
    }


    function ownsNode(bytes32 node) internal returns (bool) {
        var ownsIt = false;
        var currentOwner = ens.owner(node);
        if (currentOwner == msg.sender || currentOwner == 0) {
            ownsIt = true;
        }
        return ownsIt;
    }

    function listSubDomain(string domain, string subdomain, uint amount) {
        var node = namehash(domain);
        var subNode = sha3(subdomain);
        var sHash = sha3(node, subNode);
        //require(ownsNode(node) == true);

        records[sHash].owner = msg.sender;
        records[sHash].amount = amount;
        records[sHash].name = domain;
        records[sHash].subDomain = subdomain;
        records[sHash].available = true;
        dA.push(sHash);
    }

    function buySubDomain(string domain, string subdomain) payable {
        var nhash = namehash(domain);
        var labelhash = sha3(subdomain);
        var sHash = sha3(nhash, labelhash);

//        require (records[sHash].available == true);
//        require (msg.value > records[sHash].amount);

        records[sHash].owner.transfer(records[sHash].amount);
        ens.setSubnodeOwner(nhash, labelhash, msg.sender);
        ens.setOwner(nhash, records[sHash].owner);
        records[sHash].available = false;
//        msg.sender.transfer(msg.value - records[sHash].amount);
    }


    /**
     * Register a name, or change the owner of an existing registration.
     * @param name the string of the name
     * @param amount the amount for ethereum
     */
    function listName(string name, uint amount) {
        var node = namehash(name);
        require(ownsNode(node) == true);

        records[node].owner = msg.sender;
        records[node].amount = amount;
        records[node].name = name;
        records[node].available = true;
        records[node].subDomain = "";
        dA.push(node);
    }

    function getRecord(uint i) public returns(string, uint, bool, string) {
        bytes32 node = dA[i];
        return (records[node].name, records[node].amount, records[node].available, records[node].subDomain);
    }


    function buy(string name) payable {
        var nhash = namehash(name);
        ens.setOwner(nhash, msg.sender);
        records[nhash].available = false;
    }

    function getCount() public returns (uint) {
        uint i = dA.length;
        return i;
    }

    function namehash(string name) internal returns(bytes32) {
        var nameSlice = name.toSlice();

        if (nameSlice.len() == 0) {
            return bytes32(0);
        }

        var label = nameSlice.split(".".toSlice()).toString();
        return sha3(namehash(nameSlice.toString()), sha3(label));
    }

    /**
    * @dev Calculates labelHash of ENS name
    * @param name string Plaintext ENS name
    * @return bytes32 ENS labelHash, hashed label of the name
    */
    function getLabelHash(string name) internal returns(bytes32) {
        return sha3(name.toSlice().split(".".toSlice()).toString());
    }
}
